// SPDX-License-Identifier: UNLICENSED

pragma solidity ^ 0.8.0;

contract debay {

    bool contract_paused;
    address admin;

    constructor () {
        admin = msg.sender;
    }

    struct auction {
        address initiator;
        address highest_bidder;
        address winner;
        string item_name;
        string image_url;
        string description;
        uint price_floor;
        uint deadline;
        bool finished;
    }

    mapping(bytes32 => auction) public auctions;
    mapping(address => uint) public userfunds;

    function togglePause() public {
        require(msg.sender == admin);
        (contract_paused) ? contract_paused = false : contract_paused = true;
    }
    

    function startAuction(string calldata name, string calldata imgUrl, string calldata description, uint256 floor, uint256 deadline) external onlyNotPaused returns (bytes32) {
        
        bytes32 auctionIdGenerator = keccak256(abi.encodePacked(name, imgUrl, description, floor, deadline));
        auctions[auctionIdGenerator] = auction(msg.sender, address(0), address(0), name, imgUrl, description, floor, block.timestamp + deadline * 1 hours, false);

        return auctionIdGenerator;

    }

    function bid_algorithm(uint amount, bytes32 auctionId) private  {

        auction storage _auction = auctions[auctionId];
        require(_auction.initiator != msg.sender);
        require(_auction.highest_bidder != msg.sender);
        require(_auction.deadline > block.timestamp, "Auction expired.");
        require(_auction.price_floor < amount, "Your bid isn't enough to replace the price floor.");
        require(_auction.highest_bidder != msg.sender, "You already are the highest bidder.");
        
        if (_auction.highest_bidder != address(0)) {
            userfunds[_auction.highest_bidder] += _auction.price_floor;
        }

        _auction.price_floor =  amount;
        _auction.highest_bidder = msg.sender;

    }

    function bid(bytes32 auctionId) external payable onlyNotPaused {
        require(msg.value > 0);
        bid_algorithm(msg.value, auctionId);
    }
    
    function bid(bytes32 auctionId, uint256 amount) external onlyNotPaused {
        require(amount > 0 && amount <= userfunds[msg.sender]);
        bid_algorithm(amount, auctionId);
        userfunds[msg.sender] -= amount;
    }

    function settle(bytes32 auctionId) external onlyNotPaused {
        require(auctions[auctionId].deadline <= block.timestamp && auctions[auctionId].finished == false, "Auction deadline is not accomplished.");
        auctions[auctionId].finished = true;
        auctions[auctionId].winner = auctions[auctionId].highest_bidder;
    }
    
    function deposit() external payable onlyNotPaused {
        userfunds[msg.sender] += msg.value;
    }
    
    function withdraw() external onlyNotPaused {
        require(userfunds[msg.sender] > 0, "You don't have saved funds.");
        uint amount = userfunds[msg.sender];
        userfunds[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
    }

    function see_winner(bytes32 auctionId) view external returns (address) {
        return auctions[auctionId].winner;
    }

    function see_highest_bidder(bytes32 auctionId) view external returns(address) {
        return auctions[auctionId].highest_bidder;
    }

    function getAuctionId(string calldata name, string calldata imgUrl, string calldata description, uint256 floor, uint256 deadline) external pure returns(bytes32) {
        bytes32 auctionIdGenerator = keccak256(abi.encodePacked(name, imgUrl, description, floor, deadline));
        return auctionIdGenerator;
    }

    modifier onlyNotPaused() {
        require(contract_paused == false, "Contract paused!");
        _;
    }


}
